    false,nt"url": null,nt"notes": "This annual narrative report for Ardoch
    Lake, Kellys Slough, Devils Lake National Wildlife Refuge outlines Refuge accomplishments
    during the 1964 calendar year.  The report begins by summarizing the weather conditions,
    habitat conditions, water conditions, and food and cover conditions during the year.
    Wildlife- including migratory birds, upland game birds, predators, rodents, mammals,
    and diseases- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and vegetation control. Resource management is
    outlined; topics include grazing and haying. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, and hunting. Items of interest and
    N-R forms are attached",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
